import classes from "./Current-weather.module.css";

const CurrentWeather = () => {
  return (
    <div className={classes.weather}>
      <div className={classes.top}>
        <p className={classes.city}>Belgrade</p>
        <p className={classes.weatherdescription}>Sunny</p>
      </div>
      <img alt="weather" className={classes.weathericon} src="icons/01d.png" />
    </div>
  );
};

export default CurrentWeather;
